function initializeFilters(){var t,n;if(predefinedFilterProperties.length===0){$("#predefinedFilter").hide();return}for(t=$("#filter1Key"),n=0;n<predefinedFilterProperties.length;n++)t.append("<option>"+predefinedFilterProperties[n]+"<\/option>")}function LoadLogs(){$.getJSON("/Log/").fail(function(){console.error("Error loading log.")}).done(function(n){logs=n;filterAndShowLogs()})}function filterAndShowLogs(){logsFiltered=filterLogs(logs);var n=$.templates("#logRowTmpl"),t=n.render({logs:logsFiltered});$("#logTable tbody").html(t);$("#logTable tr").click(function(){var t=+$(this).attr("data-logId"),n,i,r;isNaN(t)||(n=logsFiltered.filter(function(n){return n.id===t})[0],n!==null)&&(i=$.templates("#logModalTmpl"),r=i.render(n),$("#logModal .modal-dialog").html(r),$("#logModal").modal("show"))})}function filterLogs(n){var i=[],r=$("#filter1Key").val(),t=$("#filter1Value").val();for(let u=0;u<n.length;u++)t!==null&&t.length>0&&$(n[u].properties).find("property[key='"+r+"']").text()!==t||i.push(n[u]);return i}var logs=[],logsFiltered=[];$(document).ready(function(){initializeFilters();LoadLogs()});